  true,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry, magnetics, and gravity
  data along with transit satellite navigation data was collected as part of field
  activity L-8-77-BS in Bering Sea, Alaska from 07/29/1977 to 08/21/1977, http://walrus.wr.usgs.gov/infobank/l/l877bs/html/l-8-77-bs.meta.html
  These data are reformatted from space-delimited ASCII text files located in the
  Coastal and Marine Geology Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/l/l877bs/html/l-8-77-bs.bath.html
  http://walrus.wr.usgs.gov/infobank/l/l877bs/html/l-8-77-bs.grav.html http://walrus.wr.usgs.gov/infobank/l/l877bs/html/l-8-77-bs.mag.html
  into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
  The MGD77T format includes a header (documentation) file (.h77t) and a data file
  (.m77t). More information regarding this format can be found in the publication
  listed in the Cross_reference section of this metadata file.\",\n\t\"license_title\":
